// DishesPage.js
import React from 'react';
import { useParams, Link } from 'react-router-dom';
import dishesData from '../Data/dishes.json';

function DishesPage() {
  const { state } = useParams();
  const dishes = dishesData[state] || [];

  return (
    <div>
      <h1>Dishes in {state}</h1>
      <ul>
        {dishes.map(dish => (
          <li key={dish.id}>
            <Link to={`/dish/${state}/${dish.id}`}>
              <h2>{dish.title}</h2>
              <img src={dish.image} alt={dish.title} width="100" />
            </Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default DishesPage;
